INSERT INTO "plants" VALUES(28,'Amelanchier alnifolia',2,20,28,'Saskatoon Serviceberry','Growing to 20'' at maturity this lovely tree-shrub is absolutely covered with clusters of white blossoms in the late spring. Attractive rounded bluish green foliage up to 1" wide turns lovely shades of yellow in the fall. Need some water.','2015-03-08 22:35:43.718774','2015-03-12 23:54:32.769756','WW(24)-CT(90-120)-CTD');
INSERT INTO "plants" VALUES(29,'Androsace septentrionalis',11,21,29,NULL,'','2015-03-08 22:39:36.405630','2015-03-08 22:45:21.600720',NULL);
INSERT INTO "plants" VALUES(30,'Amorpha nana',NULL,22,30,'Dwarf indigo','A small shrub only 2 1/2'' at maturity with fine feathery foliage that is covered with little hairs that make them look gray and fuzzy. Very drought tolerant. Flowers are purple spikes born in mid-summer. Fall foliage is insignificant.','2015-03-09 14:29:42.046244','2015-03-12 23:54:33.049077','WW(72)-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(32,'Acer glabrum var.douglasii',13,24,32,'','','2015-03-09 14:34:03.389451','2015-03-15 11:03:51.619512','');
INSERT INTO "plants" VALUES(33,'Abronia fragrans',NULL,25,33,'Sand-Verbena, Prairie Snowball','A graceful mound of loose stems, graced with large umbels of showy, fragrant white flowers. Blooms for up to six weeks. Likes it dry.','2015-03-11 01:13:08.666693','2015-03-11 10:29:54.233512',NULL);
INSERT INTO "plants" VALUES(34,'Acer glabrum',13,24,32,'Rocky Mountain Maple','Large vase shaped tree-shrubs up to 15 feet tall with handsom three lobed maple leaves up to 3 inches across. Fall color is bright yellow often blushing red. Attractive winged seed remain on the branches through most of the winter.','2015-03-11 01:13:09.338647','2015-03-15 11:11:07.776708','HY-CT(120-180)-CTD');
INSERT INTO "plants" VALUES(35,'Acer grandidentatum',13,24,34,'Wasatch Maple','','2015-03-11 01:13:09.611922','2015-03-13 11:22:35.286064',NULL);
INSERT INTO "plants" VALUES(36,'Achillea lanulosa',NULL,26,35,'Yarrow, Bone Set',' This drought tolerant perennial produces bone white flowers in early summer. With a height of about 24" tall and a spread of about 20" this plant works well in flowering boarders and dry-land landscapes.','2015-03-11 01:13:09.869454','2015-03-12 23:54:25.965371','DS-NC');
INSERT INTO "plants" VALUES(37,'Aconitum columbianum (dormant)',NULL,27,36,'Native Monkshood',NULL,'2015-03-11 01:13:10.104958','2015-03-11 01:13:10.205041',NULL);
INSERT INTO "plants" VALUES(38,'Agastache barbari',NULL,28,37,'Barbari''s Agastache',NULL,'2015-03-11 01:13:10.311721','2015-03-11 01:13:10.439212',NULL);
INSERT INTO "plants" VALUES(39,'Agastache cana',NULL,28,38,'Double Bubblemint','This member of the mint family sports spikes of bright pink flowers for quite a show. It is an herb and has very fragrant foliage throughout the growing seasonand looks lovely in the perennial border.','2015-03-11 01:13:10.571622','2015-03-11 10:29:56.641253',NULL);
INSERT INTO "plants" VALUES(40,'Agastache urticifolia',NULL,28,39,'Horse Nettle, Nettle-leaf Hyssop','This perennial herb grows up to 24" tall and is a member of the mint family. The flowers born in mid-summer range from white to rose with a rose calyx on flowering spikes up to 6" long. The foliage is very fragrant. Nice for flowering borders and herb gardens.','2015-03-11 01:13:10.849225','2015-03-12 23:54:26.132326','HY-CTD');
INSERT INTO "plants" VALUES(41,'Agave neomexicana',NULL,29,40,'New Mexican Century-Plant',NULL,'2015-03-11 01:13:11.173835','2015-03-11 01:13:11.286824',NULL);
INSERT INTO "plants" VALUES(42,'Albizia julibrissin',NULL,30,41,'Silk-tree, Mimosa','This small tree has lovely feathery foliage up to 10" long and 5" wide. The flowers are pink and showy clusters covering the end of each branch. Seed are born in delicate pods 6" long in the fall. This seed source is from zone 6 ( 0 to -10 degrees). They also make attractive house plants.','2015-03-11 01:13:11.418476','2015-03-12 23:54:26.478193','WW(72)-CTD');
INSERT INTO "plants" VALUES(43,'Allium cernuum',NULL,31,42,'Nodding Onion','This edible native has showy clusters of nodding pale pinkish purple flowers up to 2" across rising on slender stem about 8" to 10" tall. It blooms in early summer and looks best grown with several together. Very drought tolerant. Blooms the second season.','2015-03-11 01:13:11.656881','2015-03-12 23:54:26.299832','CT(60-120)-CTD');
INSERT INTO "plants" VALUES(44,'Alnus tenuifolia',NULL,32,43,'Thinleaf Alder','A nice tree-shrub with large dark green leaves up to 5" long and 3" wide. Attractive gray bark and nice branching with persistent seed cones give it handsom winter intrest. 20'' to 25'' tall at maturity this plant makes a good screen or stand alone. Grows more rapidly in moist conditions but will tolerate drought. Fall color is yellow/brown.','2015-03-11 01:13:11.880517','2015-03-12 23:54:26.600774','CT(90-120)-CTD');
INSERT INTO "plants" VALUES(45,'Amelanchier utahensis',NULL,20,44,'Utah Serviceberry','Smaller than it''s cousin listed before the Utah Serviceberry only grows to 15'' tall. Extremely drought tolerant with the same lovely flowers and very nice but smaller foliage. A dry-land landscape must.','2015-03-11 01:13:12.312998','2015-03-12 23:54:33.182814','WW(24)-CT(90-120)-CTD');
INSERT INTO "plants" VALUES(46,'Amorpha canescens',NULL,22,45,'Leadplant','This small shrub has a delicate soft look. It grows to 4'' tall and has a pleasant rounded shape. Spikes of purple flowers appear in mid-summer that become seed heads in the fall.','2015-03-11 01:13:12.565937','2015-03-12 23:54:32.890450','WW(72)-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(47,'Amorpha fruticosa',NULL,22,46,'False Indigo','Up to 8'' tall in well watered situations this shrub makes a spray of branches with large pinnate feathery foliage. 10" spikes of dark purple flowers bloom in mid-summer. Fall color is yellow.Good for the dry-land landscape.','2015-03-11 01:13:12.803971','2015-03-11 10:29:58.179312',NULL);
INSERT INTO "plants" VALUES(48,'Amsonia Jonesii',NULL,33,47,'Jones''  Bluestar',NULL,'2015-03-11 01:13:13.179797','2015-03-11 01:13:13.341075',NULL);
INSERT INTO "plants" VALUES(49,'Anaphalis margaritacea',NULL,34,48,'Pearly Everlasting','Called everlasting for the white blooms that persist through the fall forming in clusters atop mats of attractive silver foliage. Handsome in any garden and makes wonderful dried arrangements.','2015-03-11 01:13:13.494748','2015-03-12 23:54:22.585653','DS-NC');
INSERT INTO "plants" VALUES(50,'Andropogon gerardii',NULL,35,49,'Big Bluestem, Turkeyfoot','This grass makes a lovely ornamental singly or in groups. Growing to 4'' tall. In the fall it turns a mohogany to rose red and remains a nice show of color in the garden until late winter.','2015-03-11 01:13:13.741459','2015-03-12 23:54:33.806969','DS-CTD');
INSERT INTO "plants" VALUES(51,'Andropogon scoparius ''Blaze'' (Schizachrium s.)',NULL,35,50,'Little Bluestem','This lovely grass grows to 28" tall and works well as an ornamental in groupings or singly. It is very drought tolerant and has a fabulous fall red fall color with its'' small white downy seed sprinkled on the upper spikes. Handsom indeed.','2015-03-11 01:13:13.959361','2015-03-12 23:55:01.301201','DS-CTD');
INSERT INTO "plants" VALUES(52,'Androsace septentrionalis - annual',NULL,21,29,'Rock Primrose','This delicate little annual is charming in the rock garden. Rising from small tuffted rosettes of dark green foliage the flower stem rises 2" to 4" crowned with an airy cluster of numerous small star shaped flowers. Will reseed with a little help. Can also be fun indoors.','2015-03-11 01:13:14.184704','2015-03-12 23:54:23.198898','DS-NC');
INSERT INTO "plants" VALUES(53,'Anemone canadensis',NULL,36,51,'Meadow Anemone','Delicate white flowers on rich dark green leaves. A nice addition to any cottage garden. Grows to about 14" with flower about 3/4" across. Nice foliage texture. Part shade to full sun.','2015-03-11 01:13:14.459459','2015-03-12 23:54:33.305527','CT(60-90)-CTD');
INSERT INTO "plants" VALUES(54,'Anemone cylindrica',NULL,36,52,'Cylindrical Windflower','Dark green disected foliage and interesting coneheaded flowers with whitish sepals makes a nice addition to a native boarder garden. Charming fluffy seed heads give fall interest. Blooms in summer.','2015-03-11 01:13:14.821965','2015-03-12 23:54:33.461491','CT(60-90)-CTD');
INSERT INTO "plants" VALUES(55,'Anemone multifida',NULL,36,53,'Cutleaf Anemone, Globeflower','Pink-red wine colored flowers are  pleasingly delicate.It does best in part shade but will tolerate full sun. Attractive woolly seedheads are produced in the fall. Among the showiest native anemones.','2015-03-11 01:13:15.180787','2015-03-12 23:54:31.017809','CT(60-90)-CTD');
INSERT INTO "plants" VALUES(56,'Anemone patens (Pulsatilla p.)',NULL,36,54,'Pasque Flower',NULL,'2015-03-11 01:13:15.469465','2015-03-11 01:13:15.662189',NULL);
INSERT INTO "plants" VALUES(57,'Antennaria dioica (A.umbrinella)',NULL,37,55,'Mountain Pussytoes',NULL,'2015-03-11 01:13:15.840771','2015-03-11 01:13:16.018855',NULL);
INSERT INTO "plants" VALUES(58,'Antennaria parvifolia',NULL,37,56,'Mountain Pussytoes','The rosettes on this pussytoes are about 1" across and remain silver throughout the season and are graced by a stand of lovely white flower rising on stems','2015-03-11 01:13:16.173157','2015-03-12 23:54:22.864394','DS-NC');
INSERT INTO "plants" VALUES(59,'Antennaria p.''Titter Tat''',NULL,37,57,'''Titter Tat'' Pussytoes','This nifty little pussytoes has tiny rosettes of silver foliage at most 1/2" across with delicate white flowers rising on stems 5" to 6" tall in early summer. Prefers full sun and is a great candidate for the rock garden staying more compact than others of its'' kind.','2015-03-11 01:13:16.440814','2015-03-12 23:54:23.321616','DS-NC');
INSERT INTO "plants" VALUES(60,'Antennaria rosea',NULL,37,58,'Pink Pussytoes, Pink Ladies Tobacco','My favorite of the pussytoes this seed collection will produce rosettes of silvery foliage up to 1/2" across that is covered by blossoms ringed in dark-rose rising on stems 3" tall in early summer. Does well in full sun or part shade, great between flagstones and work well for contrast in a boarder.','2015-03-11 01:13:16.672996','2015-03-12 23:54:23.066496','DS-NC');
INSERT INTO "plants" VALUES(61,'Aquilegia caerulea',NULL,38,59,'Rocky Mountain Columbine','Colorado''s state flower. This lovely, graceful native works well inpart shade to full sun. Delicate three parted foliage in a soft mound up to 10" tall topped by striking blue flowers with characterstic spurs surrounding a star of white petals in its'' nodding middle. When you think of wild flowers this is it. It adds grace to any garden.','2015-03-11 01:13:16.921440','2015-03-12 23:54:28.765820','CT(60-90)-CTD');
INSERT INTO "plants" VALUES(62,'Aquilegia chrysantha',NULL,38,60,'Golden Columbine','Bright yellow flowers on stems rising to 3'' tall cover an elegant mound of foliage 12" to 16" tall that blushes purple-red in the fall. Great mixed in a perennial boarder. Blooms early summer and repeats its'' bloom with only a bit less flair in late summer/ early fall. Very Showy!','2015-03-11 01:13:17.165037','2015-03-12 23:54:28.910814','CT(60-90)-CTD');
INSERT INTO "plants" VALUES(63,'Arctostaphylos ''Bad Boy''',NULL,39,61,'''Bad Boy'' Manzanita',NULL,'2015-03-11 01:13:17.444034','2015-03-11 01:13:17.567803',NULL);
INSERT INTO "plants" VALUES(64,'Arctostaphylos ''GreenJazz''',NULL,39,62,'''Green Jazz'' Manzanita',NULL,'2015-03-11 01:13:17.722211','2015-03-11 01:13:17.893884',NULL);
INSERT INTO "plants" VALUES(65,'Arctostaphylos ''Lost Arrow''',NULL,39,63,'''Lost Arrow'' Manzanita',NULL,'2015-03-11 01:13:18.025337','2015-03-11 01:13:18.194948',NULL);
INSERT INTO "plants" VALUES(66,'Arctostaphylos ''Mock Bearberry''',NULL,39,64,'Mock Bearberry Manzanita',NULL,'2015-03-11 01:13:18.350503','2015-03-11 01:13:18.496069',NULL);
INSERT INTO "plants" VALUES(67,'Arctostaphylos nevadensis',NULL,39,65,'Pine-Mat',NULL,'2015-03-11 01:13:18.681765','2015-03-11 01:13:18.852813',NULL);
INSERT INTO "plants" VALUES(68,'Arctostaphylos patula',NULL,39,66,'Greenleaf Manzanita','Rounded evergreen foliage up to 1" across rising above stiking reddish-nuttybrown trunks make this slow growing shrub a year around pleasure in the garden. These evergreens grow up to 3'' tall and can spead to 5'' wide. Clusters of pink-white urn-shaped flowers bloom in early spring, often before the snow is gone. Not easy and quite slow but well worth while.','2015-03-11 01:13:18.984878','2015-03-12 23:54:34.653798','WW(72)-CT(120-576)-CTD');
INSERT INTO "plants" VALUES(69,'Arctostaphylos Pringlei',NULL,39,67,'Pringlei''s Greenleaf Manzanita',NULL,'2015-03-11 01:13:19.226746','2015-03-11 01:13:19.388296',NULL);
INSERT INTO "plants" VALUES(70,'Arctostaphylos pungens',NULL,39,68,'Pointleaf Manzanita','This useful, elegant shrub grows to a height of 14" to 18" tall and will spread to 5'' wide. The pointed evergreen foliage up to 1" long and 1/2" wide rises above reddish-nuttybrown branches that creep along the ground as it spreads. Showy throughout the season with pinkish-white blossoms dotting it in early spring often before the snow melts. Not easy but well worth it!','2015-03-11 01:13:19.521299','2015-03-12 23:54:35.235148','WW(72)-CT(120-576)-CTD');
INSERT INTO "plants" VALUES(71,'Arctostaphylos uva-ursi',NULL,39,69,'Kinnikinnick, Bearberry','A creeping evergreen groundcover, handsom throughout the year,  works well in part shade and grows no taller than 5" and spreads to 4'' wide. White urn-shaped flower bloom in the early spring. In fall it is dotted with attractive red berries that hold through the winter and are a bird attractor. Faster than the others of this genus but still not easy.','2015-03-11 01:13:19.853446','2015-03-12 23:54:35.480511','WW(72)-CT(120-576)-CTD');
INSERT INTO "plants" VALUES(72,'Arctostaphylos ''Zorra''',NULL,39,70,'''Zorra'' Manzanita',NULL,'2015-03-11 01:13:20.157176','2015-03-11 01:13:20.335987',NULL);
INSERT INTO "plants" VALUES(73,'Arenaria hookeri',NULL,40,71,'Hooker''s Sandwort',NULL,'2015-03-11 01:13:20.478832','2015-03-11 01:13:20.625986',NULL);
INSERT INTO "plants" VALUES(74,'Argemone polyanthemos',NULL,41,72,'Prickly Poppy','Icy-blue leaves 3" long with whitish veins are truly stunning on this dryland perennial. It does have very small prickly spines are on the edges of the leaves, on the stems and on the seed pods. Large, showy, white, poppy-like flowers up to 4" across with 1" bright orange centers on this long blooming native make a car stopper. It blooms in mid-summer and continues through the fall. The milky juice in the stem is bright orange. Hmmm.','2015-03-11 01:13:20.795563','2015-03-12 23:54:34.956645','HY-CT(60-120)-CTD');
INSERT INTO "plants" VALUES(75,'Aristida purpurea',NULL,42,73,'Three Awn Grass','This cute ornamental grass is only 6" tall with very fine leaves giving it a soft appearance. It looks nice planted in groupings. Each plant is about 8" to 12" across. In the fall the leaves turn a blush of purple with wheat colored seed that have 3 long antenna-like structures for seed dispersal.','2015-03-11 01:13:21.147181','2015-03-12 23:54:35.101565','DS-CTD');
INSERT INTO "plants" VALUES(76,'Arnica cordifolia',NULL,43,74,'Heartleaf Arnica','Bright orange-yellow flowers 2" across and up to 8" tall, thrive in part shade. The foliage is made up of basal, spade shaped, fuzzy leaves to 2" wide. Very showy and useful to brighten a shady north face.','2015-03-11 01:13:21.517923','2015-03-12 23:54:29.033531','DS-LC');
INSERT INTO "plants" VALUES(77,'Artemisia cana',NULL,18,38,'Silver Sagebrush',NULL,'2015-03-11 01:13:21.827367','2015-03-11 01:13:21.975887',NULL);
INSERT INTO "plants" VALUES(78,'Artemisia dracunculus',NULL,18,75,'Wild Tarragon','This native herb though not showy of flower makes a handsom addition to a dryland perennial garden or herb garden. It is vase shaped growing to about 18" to 20" tall with light green leaves contrasting against brassy colored stems. The shape, texture and herbal fragrance make it a delight in the garden. It also dries well.','2015-03-11 01:13:22.094325','2015-03-12 23:54:29.156107','DS-NC');
INSERT INTO "plants" VALUES(79,'Artemisia frigida',NULL,18,76,'Fringed Sagebrush, Prairie Sagewort','Fringed Sage forms a small mound of tufted silver foliage about 3" to 5" high with slender 6" seed heads rising above the silvery folige in the late summer. Spreading to 12" this plant will make a great ground cover in mass or striking individual accent in a dryland garden or perennial boarder.','2015-03-11 01:13:22.505276','2015-03-12 23:54:29.401567','DS-NC');
INSERT INTO "plants" VALUES(80,'Artemisia ludoviciana',NULL,18,77,'Louisiana Sage','This handsom, tall, spreading, groundcover is not hard to grow and can be used in those tough-to-start-anything places or is quite well behaved enough to place in dry areas of a perennial boarder. Growing to up to 30" tall and spreading to 3 1/2'' with silver-gray foliage that dies back to the ground in the fall, this sage adds a splash of silver-slate to set off stonework or flowering perennialsin any garden. This one is fun, easy and useful.','2015-03-11 01:13:22.765309','2015-03-12 23:54:29.513115','DS-NC');
INSERT INTO "plants" VALUES(81,'Artemisia nova',NULL,18,78,'Black Sagebrush',NULL,'2015-03-11 01:13:23.018754','2015-03-11 01:13:23.135919',NULL);
INSERT INTO "plants" VALUES(82,'Artemisia tridentata tridentata',NULL,18,13,'Tall Western Sagebrush','Striking, handsom shrubs growing from 4'' to 8'' tall and each having their own special character. Silver foliage lays in plumes on the ends of the branches in stark contrast with the grey-black peeling bark. Each plant is its'' own work of art. In addition a heady scent of ''The True West'' may be experiecced by crushing a leaf. Also may be dried and used in stews and other cooking. A must have for the dryland garden or a character accent.','2015-03-11 01:13:23.298874','2015-03-12 23:54:35.357900','DS-NC');
INSERT INTO "plants" VALUES(83,'Artemisia tridentata vaseyana',NULL,18,13,'Mountain Big Sagebrush',NULL,'2015-03-11 01:13:23.622120','2015-03-11 01:13:23.749091',NULL);
INSERT INTO "plants" VALUES(84,'Artemisia tridentata wyomingensis',NULL,18,13,'Wyoming Sagebrush',NULL,'2015-03-11 01:13:23.900731','2015-03-11 01:13:24.051281',NULL);
INSERT INTO "plants" VALUES(85,'Asclepias asperula',NULL,44,79,'Rough Milkweed','This lovely dryland perennial has flowers that form in large round clusters up 3 1/2" across covered  with 1/4" magnificent, chartreuse and purple flowers. The foliage is light green with a handsom  leathery look about it. Grows to about 18" to 20" tall. It is very showy and it loves it dry!','2015-03-11 01:13:24.205774','2015-03-12 23:54:35.625586','DS-CTD');
INSERT INTO "plants" VALUES(86,'Asclepias speciosa',NULL,44,80,'Showy Milkweed','This perennial is a great butterfly attractor. The Monarch butterfly uses this as a host plant for its'' brood. Beyond that, the beauty of the flowers is outstanding. Numerous round umbells of two tone pink flower clusters up to 4" across, grace this sturdy plant with a height up to 30".','2015-03-11 01:13:24.585119','2015-03-12 23:54:36.183115','DS-CTD');
INSERT INTO "plants" VALUES(87,'Asclepias tuberosa',NULL,44,81,'Butterfly Weed, Gay Butterflies','Bright orange flowers blaze atop this fabulous butterfly attractor. Growing to 18" this drought tolerant and useful perennial is as much at home in a wildflower boarder as in a ''nothing can grow here'' dirt strip. Very showy and not too difficult. Blooms the second season.','2015-03-11 01:13:24.903221','2015-03-12 23:54:36.305765','DS-CTD');
INSERT INTO "plants" VALUES(88,'Asclepias undulata',NULL,44,82,'Wavy Butterfly Weed',NULL,'2015-03-11 01:13:25.161865','2015-03-11 01:13:25.277651',NULL);
INSERT INTO "plants" VALUES(89,'Asclpeias incarnata',NULL,45,83,'Pink Butterfly Weed','This tall perennial likes a bit more water. It has showy dark pink flowers across the top in 3" clusters. Reaching a height of 36" to 40" tall these will add a show to any perennial boarder or cottage garden. It also attracts butterflys. Easy and fun, plant by a low spot or drainage to give it adequate water.','2015-03-11 01:13:25.419083','2015-03-12 23:54:34.811643','DS-CTD');
INSERT INTO "plants" VALUES(90,'Aster laevis',NULL,46,84,'Smooth Aster','This showy native purple-blue aster adds a nice splash of color in the late summer. The foliage is a leathery bluish-green and the flowers with their orange-yellow centers rise on stalks up to 36" tall. Individual flowers are 1" across and cover the flower spikes in vast numbers. Easy to start, easy to care for, useful for color and its'' ''wildflower look''.','2015-03-11 01:13:25.668803','2015-03-12 23:54:35.882250','DS-LC');
INSERT INTO "plants" VALUES(91,'Aster porteri',NULL,46,85,'Porter''s Aster','Absolutely covered in 3/4" white flowers with yellow-orange centers, this aster puts on a real show. The bloom time is late summer and can be spotted from distance. Growing to a height of up to 20" tall this perennial is drought tolerant and looks  good in a wildflower boarder or makes a showy display in those ''nothing will grow here'' spots. Easy and hardy.','2015-03-11 01:13:25.978837','2015-03-12 23:54:24.860431','DS-LC');
INSERT INTO "plants" VALUES(92,'Astragalus crassicarpus',NULL,47,86,'Ground-plum',NULL,'2015-03-11 01:13:26.281309','2015-03-11 01:13:26.404124',NULL);
INSERT INTO "plants" VALUES(93,'Astragalus drummondii',NULL,47,87,'Drummond''s Milkvetch','Creamy white blossoms crown this perennial in the spring. Growing 18" to 24" tall with soft feathery foliage covered with tiny hairs that give it a greenish-silver look that is pleasing to th eye. It is super drought tolerant and can adapt to various soil conditions, unless it is too wet. Not the easiest to start but well worth the effort.','2015-03-11 01:13:26.545755','2015-03-12 23:54:35.759471','WW(72)-CT(30-60)-CTD');
INSERT INTO "plants" VALUES(94,'Astragalus multiceps ''Bonney Park''',NULL,47,88,'Bonney Park Astragalus',NULL,'2015-03-11 01:13:26.812016','2015-03-12 23:54:36.027075','WW(72)-CT(90-120)-CTD');
INSERT INTO "plants" VALUES(95,'Atriplex canescens',NULL,48,45,'Four-wing Saltbush','This useful shrub gets its'' name from its'' incredibly high salt tolerance. Growing to a height of around 4'' this saltbrush is not only extremely drought tolerant but make a great screen, fabulous bird habitat and can be planted in the harshest environments. Its'' round form is covered with silvery-grey foliage in the spring and summer and in winter has a structure of bone-white to gray branches for winter interest. Great for road side plantings and dry-land landscapes. Female plant are covered with attractive  four-winged seeds in the fall and through most of the winter.','2015-03-11 01:13:27.300559','2015-03-12 23:54:36.461868','DS-CTD');
INSERT INTO "plants" VALUES(96,'Atriplex confertifolia',NULL,48,89,'Shadscale Saltbush','Small silver bushes 14" to 18" tall with cute rounded leaves make this a great choice for a small dry-land garden or a ''tough to grow anything'' spot. Able to tolerate super hot conditions and poor soils yet look good (leap tall bulidings in a single bound), make this sure fit for those special kinda spots that never could be planted. Once planted and established it can be used as protection to start showy dryland wildflowers.','2015-03-11 01:13:27.615160','2015-03-12 23:54:36.606811','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(97,'Atriplex corrugata',NULL,48,90,'Mat Saltbush, Mancos Saltbush',NULL,'2015-03-11 01:13:27.898940','2015-03-12 23:54:36.759518','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(98,'Atriplex Gardnerii',NULL,48,91,'Gardner''s Saltbush','Along with all the characteristics that make saltbrush useful in a dryland landscape Gardner''s Saltbrush is attractive and of an intermediate size. Growing to 2 1/2'' tall and about 3'' wide with silvery-blue handsom foliage attractivly arranged, it is pleasing to the eye in color, shape and size. Salt tolerant and thriving in the hottest places it does best with minimal snow cover. Handsom and useful.','2015-03-11 01:13:28.176570','2015-03-12 23:54:36.915605','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(99,'Atriplex Nuttallii cuneata',NULL,48,92,'Nuttall''s Wedged Saltbush','Another truly drought tolerant plant this mat forming saltbrush spreads to about 24" wide and only 5" tall. The foliage is a silver steel-gray with 4" seed heads rising above the mat of foliage in the fall. Good for contasting color and its'' low groundcover quality in any dryland landscape. It is tough in garden surviving when others fail.','2015-03-11 01:13:28.500028','2015-03-12 23:54:37.086003','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(100,'Bahia dissecta (annual)',NULL,49,93,'Bahia','This showy native biennal or short lived perennial is covered with 3/4" yellow sunflower-like blossoms from mid-summer until fall and will reseed itself for the following season. It works well in full sun or part shade and will tolerate poor soil, however it performs best with better soil. It grows taller and fuller with a bit more moisture but will grow where it is a bit dry too. Easy and showy.','2015-03-11 01:13:28.792593','2015-03-12 23:54:37.375951','DS-LC');
INSERT INTO "plants" VALUES(101,'Baileya multiradiata (annual)',NULL,50,94,'Desert Marigold',NULL,'2015-03-11 01:13:29.046376','2015-03-11 01:13:29.219469',NULL);
INSERT INTO "plants" VALUES(102,'Balsamorhiza sagittata',NULL,51,95,'Balsam-root',NULL,'2015-03-11 01:13:29.390503','2015-03-12 23:54:37.565581','CT(60-90)-CTD');
INSERT INTO "plants" VALUES(103,'Baptisia australis',NULL,52,96,'Wild Blue Indigo','Native to the eastern half of the US in dry areas this member of the pea family gets up to 4'' tall and 2'' across. The flowers born in mid-summer cover the terminal spikes in giant ''knock your socks off'' showy clusters of indigo-blue flowers. A fabulous show for the perennial boarder, dryland garden, or anyplace!','2015-03-11 01:13:29.772739','2015-03-12 23:54:37.219846','WW(72)-CTD');
INSERT INTO "plants" VALUES(104,'Berlandiera lyrata',NULL,53,97,'Chocolate Flower, Green-eyes','This little perennial not only has charming flowers that do indeed smell like chocolate when they are sun-warm, but for all its'' beauty it can live and thrive where it is very dry once established. The sunflower-like blossoms are about 1" across with yellow orange petals that have red veins and the middle or disk is a dark-chocolate brown. The leaves are a soft-green color with scalloped edges. The whole plant is about 18" to 24" tall in a kind of sprawling mound up to 18" across. A real winner.','2015-03-11 01:13:30.096395','2015-03-12 23:54:37.979114','DS-CTD');
INSERT INTO "plants" VALUES(105,'Betula fontinalis',NULL,54,98,'Native River Birch','This western member of the birch family is noted for its'' striking white flecked coffee-brown trunks, beautiful yellow fall color that contrasts with its'' bark, and its'' overall form. Starting from a multistemed base widening to a large round canopy whose top branches are so fine that in the winter they have a smokey appearance. In the summer the leaves are up to 2" long, glossy green with serrate edges. Fairly fast growing with good soil and extra water, however once established it can grow without supplimental waterings. Really beautiful.','2015-03-11 01:13:30.419412','2015-03-12 23:54:37.710343','CT(90-120)-CTD');
INSERT INTO "plants" VALUES(106,'Betula glandulosa',NULL,54,99,'Bog Birch','As told by their name, these native shrubs grow where it is moist and therefore will need extra water to survive, however, they truly are fabulous. The leaves in summer are such a glossy dark-green that they reflect light. The branches are a coppery-brown and the fall color is red and yellow mixed, always an eye stopper. Growing about 4'' tall and 4'' wide it mixes well with other woodland plants. So placed appropriatly in low evevation or grown at higher altitudes where water is naturally more plentiful, this is a beautiful addition to the landscape.','2015-03-11 01:13:30.770817','2015-03-12 23:54:37.855367','CT(90-120)-CTD');
INSERT INTO "plants" VALUES(107,'Brickellia californica',NULL,55,100,'Brickellbush','This drought tolerant, native, perennial herb is great for your herb garden collection or a does well in the dryland landscape. Forming a oval mass of diamond shaped pointed leaves up to 2" long. Flower born in early summer are creamy white and about 1/8"wide on small spikes around the outer edges of the plant. The entire plant growing to 2 1/2'' tall and about 16" wide. Fun and easy.','2015-03-11 01:13:31.023523','2015-03-12 23:54:38.101963','DS-LC');
INSERT INTO "plants" VALUES(108,'Callirhoe involucrata',NULL,56,101,'Poppy Mallow, Wine Cups, Buffalo Rose',NULL,'2015-03-11 01:13:31.286781','2015-03-12 23:54:38.224619','WW(72)-CTD');
INSERT INTO "plants" VALUES(109,'Calyophus serrulatus',NULL,57,102,'Sundrops, Dainty Sundrops',NULL,'2015-03-11 01:13:31.575402','2015-03-11 01:13:31.713464',NULL);
INSERT INTO "plants" VALUES(110,'Campanula rotundifolia',NULL,58,103,'Common Harebell',NULL,'2015-03-11 01:13:31.878759','2015-03-12 23:54:38.905088','DS-NC');
INSERT INTO "plants" VALUES(111,'Campsis radicans',NULL,59,104,'Scarlet Trumpet Vine',NULL,'2015-03-11 01:13:32.171299','2015-03-12 23:54:38.748752','CT(60-90)-CTD');
INSERT INTO "plants" VALUES(112,'Castilleja chromosa',NULL,60,105,'Desert Paintbrush',NULL,'2015-03-11 01:13:32.511503','2015-03-12 23:54:23.555715','HY-CT(30-60)-CTD');
INSERT INTO "plants" VALUES(113,'Castilleja integra',NULL,60,106,'Orange Indian Paintbrush',NULL,'2015-03-11 01:13:32.869579','2015-03-12 23:54:38.347433','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(114,'Castilleja linariaefolia',NULL,60,107,'Wyoming Paintbrush',NULL,'2015-03-11 01:13:33.193295','2015-03-12 23:54:38.492486','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(115,'Castilleja miniata',NULL,60,108,'Scarlet Paintbrush',NULL,'2015-03-11 01:13:33.651286','2015-03-12 23:54:23.678341','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(116,'Castilleja rhexifolia',NULL,60,109,'Meadow  Paintbrush',NULL,'2015-03-11 01:13:34.018834','2015-03-12 23:54:23.834373','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(117,'Ceanothus Fendlerii',NULL,61,110,'Mountain Lilac, Buckbrush',NULL,'2015-03-11 01:13:34.345055','2015-03-12 23:54:39.450841','WW(72)-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(118,'Ceanothus prostratus',NULL,61,111,'Mahala-mat Ceanothus',NULL,'2015-03-11 01:13:34.811047','2015-03-12 23:54:20.900307','WW(72)-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(119,'Ceanothus velutinus',NULL,61,112,'Snowbrush, Mountain Balm, Sticky-Laurel',NULL,'2015-03-11 01:13:35.089991','2015-03-12 23:54:40.208979','WW(72)-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(120,'Celtis reticulata',NULL,62,113,'Hackberry, Nettle Tree',NULL,'2015-03-11 01:13:35.390230','2015-03-12 23:54:40.053045','WW(72)-CT(90-120)-CTD');
INSERT INTO "plants" VALUES(121,'Cerastium arvense',NULL,63,114,'Mouse-ear Chickweed',NULL,'2015-03-11 01:13:35.690640','2015-03-12 23:54:39.093857','HY-CTD');
INSERT INTO "plants" VALUES(122,'Ceratoides lanata, (Erotia lanata)',NULL,64,115,'Winterfat',NULL,'2015-03-11 01:13:35.980403','2015-03-12 23:54:39.607116','DS-NC');
INSERT INTO "plants" VALUES(123,'Cercis canadensis',NULL,65,51,'American Redbud, Judas Tree',NULL,'2015-03-11 01:13:36.371705','2015-03-12 23:54:39.306086','CT(90-120)-CTD');
INSERT INTO "plants" VALUES(124,'Cercocarpus intricatus',NULL,66,116,'Little-leaf Mountain-mahogany',NULL,'2015-03-11 01:13:36.735741','2015-03-12 23:54:38.615167','HY-CT(30-90)-CTD');
INSERT INTO "plants" VALUES(125,'Cercocarpus ledifolius',NULL,66,117,'Curl-leaf Mountain-mahogany',NULL,'2015-03-11 01:13:37.095881','2015-03-12 23:54:39.752100','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(126,'Cercocarpus montanus',NULL,66,118,'True Mountain-mahogany',NULL,'2015-03-11 01:13:37.441474','2015-03-12 23:54:39.908228','HY-CT(60-90)-CTD');
INSERT INTO "plants" VALUES(127,'Chamaebatieria millefolium',NULL,67,119,'Fernbush',NULL,'2015-03-11 01:13:37.812904','2015-03-12 23:54:40.653889','DS-LC');
INSERT INTO "plants" VALUES(128,'Chilopsis linearis',NULL,68,120,'Desert Willow',NULL,'2015-03-11 01:13:38.078142','2015-03-12 23:54:40.476199','DS-CTD');
INSERT INTO "plants" VALUES(129,'Chrysothamnus nauseosus albicaulis',NULL,69,121,'Tall Blue Rabbitbrush, White Rabbitbrush',NULL,'2015-03-11 01:13:38.425099','2015-03-12 23:54:40.799350','DS-LC');
INSERT INTO "plants" VALUES(130,'Chrysothamnus nauseosus graveolens',NULL,69,121,'False Goldenrod, Green Rabbitbrush',NULL,'2015-03-11 01:13:38.733279','2015-03-12 23:54:40.922147','DS-LC');
INSERT INTO "plants" VALUES(131,'Chrysothamnus nauseosus nauseosus',NULL,69,121,'Dwarf Blue Rabbitbrush',NULL,'2015-03-11 01:13:39.045088','2015-03-12 23:54:41.067047','DS-LC');
INSERT INTO "plants" VALUES(132,'Chrysothamnus Parryi',NULL,69,122,'Parry''s Rabbitbrush',NULL,'2015-03-11 01:13:39.348659','2015-03-12 23:54:41.189677','DS-LC');
INSERT INTO "plants" VALUES(133,'Chrysothamnus viscidiflorus',NULL,69,123,'Viscid Rabbitbrush',NULL,'2015-03-11 01:13:39.734874','2015-03-12 23:54:41.347087','DS-LC');
