INSERT INTO "plants" VALUES(404,'Yucca Harrimaniae',NULL,196,338,'Harriman''s Yucca','This yucca will remain very small and is best used up close where it can be seen because of its size. It has evergreen foliage and is most often described as cute.','2015-03-11 01:15:06.183401','2015-03-12 23:55:04.480050','HY-CTD');
