INSERT INTO "plants" VALUES(407,'Aconitum columbianum',NULL,27,36,'Native Monkshood','Found in the wild in wet meadows and along stream beds this lovely perennial requires a bit more water. Up to 4 1/2'' tall graced with dark blue flowers spreading up the flower spike, each one shaped like a hood 3/4" long.','2015-03-11 10:29:55.550819','2015-03-12 23:54:25.642328','CT(60-120)-CTD');
INSERT INTO "plants" VALUES(408,'Antennaria dioica',NULL,37,55,NULL,'Like all Pussytoes this one is a great groundcover, with silver rosettes of foliage up to 2" across that blush pink in the fall and persist in the winter making it a year around winner. The flowers born in early summer rise on stems 3" tall in clusters of showy white heads covering the plant. Very nice choice! Does well in part sun.','2015-03-11 10:29:58.921259','2015-03-12 23:54:33.651022','DS-NC');
